import Button from "./Button";

function Form({setFruit, setResult, fruit}) {

    function handleSubmit(event) {
        event.preventDefault();
        setResult("");

        const post_options = {
            method: 'POST',
            headers: { 'Content-Type' : 'application/json'},
            body: JSON.stringify({ data: fruit })
        }

        fetch("/fruits", post_options)
            .then(res => res.json())
            .then(res => setResult(res['processed'])) 
    }    

    function handleChange(event) {
        console.log(event.target.value);
        setFruit(event.target.value)
    }
    return(
        <form onSubmit={handleSubmit}>
            <div>
                <input onChange={handleChange} type="text" value={fruit} />
            </div>
            <Button type="submit" value="s"/>
        </form>
    )
}

export default Form;
